import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import MocionesList from './components/MocionesList';

const App = () => {
    const [mociones, setMociones] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/mociones')
            .then((response) => response.json())
            .then((data) => setMociones(data))
            .catch((error) => console.error('Error fetching data:', error));
    }, []);

    return (
        <div>
            <h1>Lista de Mociones</h1>
            <Link to="/crear">
                <button>Agregar Moci√≥n</button>
            </Link>
            <MocionesList mociones={mociones} />
        </div>
    );
};

export default App;
